khakilist = []
def complement(seq):
    complement_dict = {'A': 'T', 'C': 'G', 'T': 'A', 'G': 'C'}
    seq_list = list(seq)
    seq_list = [complement_dict[base] for base in seq_list]
    khakilist.append(''.join(seq_list))

for phrase in denimlist:
    complement(phrase)

